import {useListProducts} from '../../Hooks/useListProducts';
import { CSSTransition } from 'react-transition-group';
import React from 'react';
import  '../../App.css';

export default function ListProducts() {

  const Productos= useListProducts();



  return (
    <CSSTransition timeout={2000}  className="animacionItemCategoria m-2 rounded-pill position-relative botontamano ">
    <ol>

      {Productos ? Productos.map(element=><li className='animacionListaProductos'>{element.nombre}</li>) : <h2>No hay productos</h2>}

    </ol>
    </CSSTransition>

   )
}
